import React, { Component } from 'react';
import { BrowserRouter as Router, Route,Switch, Redirect} from 'react-router-dom'
import Patient from './patient/patientmain';
import Doctor from './Doctor/Doctormain';
class Home extends Component {
  // try = () => {
  //     this.props.history.push('/Patient');
  //     // this.props.history.push('/doctor')
  // }
  render() {
    return (
      <div className="App"><br/><br/><br/>
       
            <button id="b1" onClick ={this.props.history.push('/Patient')}>Patient</button>
            <button id="b2" onClick ={this.props.history.push('/doctor')}>Doctor</button>
            <Switch>
            <Route exact path="/Patient" component={Patient}/><br/><br/>
            <Route exact path="/doctor" component={Doctor} />
            </Switch>
      
      </div>
    );
  }
}
export default () => (
   <div>
      <Router>
           <Route component={Home} />
           
      </Router>
  </div>
);
